const loginPage = require('../pageobjects/loginPage');
const basePage = require('../pageobjects/basePage');
require('selenium-webdriver');

describe('Login Tests', function() {

    this.timeout(50000);

    beforeEach(function() {
        let baseUrl = "http://dev:Devserver%402020@d-v.in/";
        loginPage.go_to_url(baseUrl);
    });

    // afterEach(function() {
    //     driver.quit();
    // });
    // setTimeout(function() {driver.quit()}, 100);

    it('Invalid Login test', async() => {
        await loginPage.click_login_button();
        await loginPage.enter_login_details();
        await loginPage.validation_msg();
        await loginPage.close_login_popup();
    });

    it('Test - open and close login popup', async() => {
        await loginPage.click_login_button();
        await loginPage.close_login_popup();
    });

    it('Close Browser', async() => {
        await loginPage.closeBrowser();
    });
})

