const { assert } = require('chai');
const { Builder, until, key } = require('selenium-webdriver');
// require('chromedriver', 'geckodriver');
// let chrome = require('selenium-webdriver/chrome')

var driver = new Builder().forBrowser('chrome').build();
driver.manage().setTimeouts({implicit: 15000});

class BasePage {

    constructor() {
        // Node.js global namespace. Setting a property to this namespace makes it 
        // globally visible within the running process.
        // setTimeout(), clearTimeout(), setInterval(), clearInterval() - The built-in timer functions are globals
        global.driver = driver;
    }

    go_to_url(URL) {
        driver.get(URL);
    }

    async clickElement(locator) {
        await driver.wait(until.elementLocated(locator), 10000)
                .click()
                .catch(error => { throw(error) });
    }

    async enterText(locator, text) {
        await driver.wait(until.elementLocated(locator), 10000)
                .sendKeys(text)
                .catch(error => { throw(error) });
    }

    async getInnerText(locator) {
        return await driver.wait(until.elementLocated(locator), 10000)
                    .getText()
                    .catch(error => { throw(error) });
    }

    async getTextFieldValue(locator) {
        return await driver.findElement(locator).getAttribute('value');
    }

    // var promise = driver.getTitle();
    // promise.then(function(title) {
    //     assert.equal(title, 'Google');
    // });

    async closeBrowser() {
        await driver.quit();
    }

    // let msg = await driver.findElement(By.css('span#validation-login')).getText()
    //                     .then(function(text) {
    //                          console.log(" element :: " + text);
    //                  });

    //  driver.executeScript('return document.title').then(function(return_value) {
    //      assert.equal(return_value, 'The Internet')
    //  });

    //  async jsExecutorClick(locator) {
    //      JavascriptExecutor js = (JavascriptExecutor) driver;
    //      js.executeScript("arguments[0].click();", locator);
    //      ((JavascriptExecutor)driver).executeScript('$('#test').click();");
    //  }

    //  driver.findElement(By.xpath(".//*[@id='type']")).click();    
    //  ((JavascriptExecutor)driver).executeScript("arguments[0].click();", driver.findElement(By.xpath(".//*[@id='type']/option[3]")));

} module.exports = BasePage;

