const basePage = require('../pageobjects/basePage');
const loginPage = require('../pageobjects/loginPage');
const catalogPage = require('../pageobjects/catalogPage');

const loginData = require('../pageobjects/testData.json');
const { expect } = require('chai');
require('selenium-webdriver');

describe('*** UI Tests *** ', function() {

    this.timeout(50000);

    beforeEach(function() {
        const baseUrl = "https://admin-demo.nopcommerce.com/login";
        loginPage.go_to_url(baseUrl);
    });

    afterEach(function() {
        driver.quit();
    });

    //setTimeout(function() {driver.quit()}, 100);

    it('Invalid Login Test', async() => {
        await loginPage.enter_login_details("admin@yourstore.com", "pwd");
        await loginPage.click_login_submit_button();
        let msg = await loginPage.validation_msg();
        console.log(" Login validation message :: " + msg);
        expect(msg).include("Login was unsuccessful. Please correct the errors and try again.\nThe credentials provided are incorrect");

    });

    it('Login & Logout Test', async() => {
        await loginPage.enter_login_details("admin@yourstore.com", "admin");
        await loginPage.click_login_submit_button();
        await loginPage.click_logout_link();
        let msg = await loginPage.verify_loginpage_title();
        expect(msg).to.equal('Welcome, please sign in!');
    });

    it.only('Verify for Invalid/Valid Search item under Category menu after logged-in', async() => {
        await loginPage.enter_login_details("admin@yourstore.com", "admin");
        await loginPage.click_login_submit_button();
        await catalogPage.click_catalog_menu();
        await catalogPage.click_categories_submenu();
        await catalogPage.submit_search_value("Hello");
        let msg = await catalogPage.verify_categories_table_empty_msg();
        console.log(" No data msg :: " + msg);
        expect(msg).to.equal('No data available in table');

        await catalogPage.submit_search_value("Computer");
        let text = await catalogPage.verify_categories_table_data();
        console.log(" Table data  :: " + text);
        expect(text).to.equal('Computers');
        await loginPage.click_logout_link();
    });


    // using loginData.json file
    // loginData.forEach(function(data, username, passworod) {
    //     it.only('Login test with testdata', async()  => {
    //         await loginPage.click_login_button();
    //         console.log(" username :: " + data.username + " password :: " + data.password);
    //         await loginPage.enter_login_data(data.username, data.password);
    //         await loginPage.close_login_popup();
    //     });
    // });

    // it('Close Browser', async() => {
    //     await myAccountPage.closeBrowser();
    // });
})

