const { assert } = require('chai');
const { By } = require('selenium-webdriver');
var BasePage = require('./basePage');

class RegistrationPage extends BasePage {

    register_title = By.css('div.container.center h2');
    firstName_textfield = By.css('input[ng-model="FirstName"]');
    lastName_textfield = By.css('#basicBootstrapForm > div:nth-child(1) > div:nth-child(3) > input')
    address_textfield = By.css('#basicBootstrapForm > div:nth-child(2) > div > textarea');
    email_textfield = By.id('eid');
    phone_textfield = By.css('#basicBootstrapForm > div:nth-child(4) > div > input');
    gender_radio_button = By.css('#basicBootstrapForm > div:nth-child(5) > div > label:nth-child(1) > input');
    hobbies_checkbox = By.id('checkbox2');
    languages_textfield = By.id('msdd');
    skills_dropdown =  By.id('Skills');
    country_dropdown = By.id('countries');
    select_country_textfield = By.css('span.select2-selection.select2-selection--single');
    select_country_entryBox = By.css('input.select2-search__field');
    dobYear = By.id('yearbox');
    dobMonth = By.css('#basicBootstrapForm > div:nth-child(11) > div:nth-child(3) > select');
    dobDay = By.id('daybox');
    password_textfield = By.id('firstpassword');
    confirmPassword_textfield = By.id('secondpassword');
    submit_button = By.id('submitbtn');


    // async click_login_button() {
    //     try {
    //         await driver.findElement(By.css('a[title="Log In"]')).click();
    //     } catch(e) {
    //         console.log(e);
    //     }
    // }

    async enter_login_data(name, pass) {
        await this.enterText(this.username, name);
        await this.enterText(this.password, pass);
        await driver.findElement(this.submitButton).click();
    }

    async enter_login_details() {
        await this.enterText(this.username, 'Hello');

        // let msg = await driver.findElement(By.id('username')).getAttribute('value')
        //         .then(function(text) {
        //             console.log(text); 
        //             return text;
        //         });
        let text = await this.getTextFieldValue(this.username);
        console.log(" Entered username :: " + text);

        await this.enterText(this.password, "pass");
        await driver.findElement(this.submitButton).click();
        //await this.clickElement(By.id('login_submit'));
    }

    async validation_msg() {
        driver.sleep(1000);
        let msg =  await this.getInnerText(this.message);
        console.log(" Login validation message :: " + msg);
        assert.equal(msg, "We cannot find an account with that username");
    }

    async close_login_popup() {
        await this.clickElement(By.xpath('//*[@id="ajaxLoginModal"]/div/div/div[3]/button[2]'));
       // await driver.findElement(By.xpath('//*[@id="ajaxLoginModal"]/div/div/div[3]/button[2]')).click();
    }
}
module.exports = new RegistrationPage();

