const { assert, expect } = require('chai');
const { By, wait } = require('selenium-webdriver');
var BasePage = require('./basePage');

class MyAccountPage extends BasePage {

    // Navigation links elements
    practiceSite_link = By.css('a[href="http://practice.automationtesting.in/"]');
    myaccount_link = By.css('a[href="http://practice.automationtesting.in/my-account/"]');

    // Login page elements
    username_textfield = By.id('username');
    password_textfield = By.id('password');
    submit_button = By.name('login');
    login_validation_msg = By.css('div.woocommerce > ul > li');

    switchTo_dropdown = By.css('ul > li:nth-child(4) > a');
    alerts_link = By.css('a[href="Alerts.html"]');
    alerts_cancel_tab = By.css('a[href="#CancelTab"]');
    confirmbox_button = By.css('button.btn.btn-primary');

    // async click_Alerts_link() {
    //     await this.clickElement(this.switchTo_dropdown);
    //     await this.clickElement(this.alerts_link);
    //     await this.clickElement(this.alerts_cancel_tab);
    //     await this.clickElement(this.confirmbox_button);

    //     await driver.wait(until.alertIsPresent(), 1000).then(function() {
    //         const confirm = driver.switchTo().alert();
    //         confirm.accept();
    //     });
    // }


    async click_practice_site_link() {
        // try {
        //     await driver.wait(until.titleIs('Register'), 1000)
            await this.clickElement(this.practiceSite_link);
        // } finally {
        //     assert.ok(true);
        // }

        await driver.wait(4 *  1000).then(() => {
            console.log("  Wait for 2 sec ");
            throw new Error(" Error Occured ");
        });
        console.log(" Practice Site URL :: " + driver.getCurrentUrl());
        expect(driver.getCurrentUrl()).to.equal('http://practice.automationtesting.in/');
    }

    async click_myAccount_link() {
        await this.clickElement(this.myaccount_link);
        await driver.wait(2000);
        console.log(" My account URL :: " + driver.getCurrentUrl());
        expect(driver.getCurrentUrl()).contain('/my-account/');
    }

    async submit_invalid_login_details(uname, pwd) {
        await this.enterText(this.username_textfield, uname);
        await this.enterText(this.password_textfield, pwd);
        await this.clickElement(this.submit_button);
    }

    async verify_login_validation_msg() {
        const msg = await this.getMessageText(this.verify_login_validation_msg)
        console.log(' Validation msg :: ' + msg);
        // expect(msg
    }
}
module.exports = new MyAccountPage();

